import React from 'react';
import logo from './logo.svg';
import './App.css';
import PortfolioProject from './components/PortfolioProject';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Rasengan!
        </p>
      </header>

      <body>
        <PortfolioProject
          name="Video ThumbnailDL"
          description="A simple application that downloads Youtube video thumbnails"
          link=""
        />

        <PortfolioProject
          name="Video ThumbnailDL"
          description="A simple application that downloads Youtube video thumbnails"
          link=""
        />
      </body>
    </div>
  );
}

export default App;
